import React from 'react';

const Logo = () => {
	return (
		<nav style ={{display: 'flex', justifyContent: 'flex-start', padding: '20px'}}>
		<p className='f3 link dim black underline pa3 pointer'> Logo </p>
		</nav>
		);
}

export default Logo;
